import React from 'react';
import Card from './Card';

function CardList({ pets, images }) {


	return (
		<div>
			{
				pets.map((pet, i) => {

					for (img in images) {
						if (img.pets_id === pets[i].id) {
							let file = img.url;
						}
					}
					return <Card key={pets[i].id} img={'http://localhost:4412/api/file/' + file} name={pets[i].name} description={pets[i].description}/>
				})
			}
		</div>
	);
}

export default CardList;
